import React from 'react';
import Carousel, { autoplayPlugin } from '@brainhubeu/react-carousel';
import '@brainhubeu/react-carousel/lib/style.css';

const QuoteCarousel = () => {
  return (
    <div>
      <Carousel
    plugins={[
     'arrows'
  ]}   
  animationSpeed={1000}
>
        <img src='images/Accenture.png' />    
        <img src='images/Accenture.png' />    
        <img src='images/Accenture.png' />    
        <img src='images/Accenture.png' />    
      </Carousel>
    </div>
  );
};

export default QuoteCarousel;
